import React from 'react';

class NewEntry extends React.Component {
    render() {

        const newEntryCss = {
           marginTop : "20px",
           marginBottom : "10px"
        }

        return (
            <div className='newEntry col-xs-4'>
                <form>
                <div className="form-group">
                        
                        <input type="text" placeholder="Type of activity" id="activityNameInput" name="activityName" className="form-control" style={newEntryCss}></input>
                        <input type="number" placeholder="Distance" id="distanceInput" name="distance"></input>
                        <input type="submit" placeholder="Dodaj"></input>

                 </div>
                </form>
            </div>
        )
    };
};

export default NewEntry;
